const confirmBtn = {
    type: 'submit',
    className:
      'absolute left-[390px] bottom-[52px] bg-none text-[#9699AA] text-[16px] font-medium hover:text-[#022959]',
    name: 'Confirm',
}

export default confirmBtn;
